import isUndefined from 'lodash.isundefined';
import Tether from 'tether';

import styles from 'main.scss';

export default class Highlighter {
  constructor() {
    this.padding = 5;
    this.element = document.createElement('div');
    this.element.setAttribute('class', styles.tentHighlight);
    this.element.style.display = 'none';
    document.body.appendChild(this.element);
  }

  highlight(target) {
    this.element.style.display = 'block';
    this.element.style.width = `${target.offsetWidth + this.padding}px`;
    this.element.style.height = `${target.offsetHeight + this.padding}px`;
    if (!isUndefined(this.tether)) {
      this.tether.target.classList.remove(styles.tentHighlightTarget);
      this.tether.destroy();
    }
    target.classList.add(styles.tentHighlightTarget);
    this.tether = new Tether({
      target,
      element: this.element,
      attachment: 'center middle',
      targetAttachment: 'center middle',
    });
  }
}

import isEqual from 'lodash.isequal';
import isNil from 'lodash.isnil';
import pick from 'lodash.pick';
import { load, save } from 'api';
import { updateField } from 'redux/proxyActions';
import { currentContextSelector } from 'redux/selectors';
import {
  LOAD_ANNOTATIONS,
  LOAD_ANNOTATIONS_PROXY,
  SAVE_ANNOTATED_ITEMS,
  SAVE_ANNOTATED_ITEMS_PROXY,
  SELECT_ELEMENT_PROXY,
  UPDATE_FIELD,
  UPDATE_FIELD_PROXY,
} from 'redux/constants';

// NOTE: The `alias` middleware allows async actions to be triggered from the
// proxy store but carried out on the background page. Read more at:
// https://github.com/tshaddix/react-chrome-redux/wiki/Advanced-Usage
export default {
  [LOAD_ANNOTATIONS_PROXY]: () => (dispatch, getState) => dispatch({
    type: LOAD_ANNOTATIONS.BASE,
    payload: load(getState()),
  }),

  [SAVE_ANNOTATED_ITEMS_PROXY]: () => (dispatch, getState) => dispatch({
    type: SAVE_ANNOTATED_ITEMS,
    payload: save(getState()),
  }),

  [SELECT_ELEMENT_PROXY]: action => (dispatch, getState) => {
    const { currentAnnotation, currentIndex, currentField } = getState();
    if (currentAnnotation && !isNil(currentIndex) && currentField) {
      return dispatch(
        updateField(
          currentAnnotation,
          currentIndex,
          currentField,
          {
            content: action.content,
            sources: [action.selector],
          },
          action.append,
        ),
      );
    }
    return Promise.resolve();
  },

  [UPDATE_FIELD_PROXY]: action => (dispatch, getState) => {
    const currentMapping = currentContextSelector(getState())[
      action.annotationName].collectionMappings[action.collectionIndex][action.fieldName];
    if (!isEqual(action.mapping, pick(currentMapping, Object.keys(action.mapping)))) {
      // Only fire action if something will change
      dispatch({
        ...action,
        type: UPDATE_FIELD,
      });
    }
  },
};

import { promiseActionTypes } from 'redux/promiseHelpers';

export const PORT_NAME = 'TENT';

export const ADD_COLLECTION_MAPPING = 'ADD_COLLECTION_MAPPING';
export const CLEAR_ERROR = 'CLEAR_ERROR';
export const DELETE_COLLECTION_MAPPING = 'DELETE_COLLECTION_MAPPING';
export const LOAD_ANNOTATIONS = promiseActionTypes('LOAD_ANNOTATIONS');
export const LOAD_ANNOTATIONS_PROXY = 'LOAD_ANNOTATIONS_PROXY';
export const SAVE_ANNOTATED_ITEMS = promiseActionTypes('SAVE_ANNOTATED_ITEMS');
export const SAVE_ANNOTATED_ITEMS_PROXY = 'SAVE_ANNOTATED_ITEMS_PROXY';
export const SELECT_ELEMENT_PROXY = 'SELECT_ELEMENT_PROXY';
export const SET_CONTEXT_KEY = 'SET_CONTEXT_KEY';
export const SET_CURRENT_FIELD = 'SET_CURRENT_FIELD';
export const UPDATE_FIELD = 'UPDATE_FIELD';
export const UPDATE_FIELD_PROXY = 'UPDATE_FIELD_PROXY';

import endsWith from 'lodash.endswith';
import mapValues from 'lodash.mapvalues';

// TODO(jrbotros): remove this when we can import from package
// https://github.com/pburtchaell/redux-promise-middleware/issues/143
export const promiseTypeSuffixes = ['PENDING', 'FULFILLED', 'REJECTED'];
const [PENDING, FULFILLED, REJECTED] = promiseTypeSuffixes;
const promiseTypes = {
  PENDING,
  FULFILLED,
  REJECTED,
};

export const promiseActionTypes = baseType => ({
  ...mapValues(promiseTypes, suffix => `${baseType}_${suffix}`),
  BASE: baseType,
});

export const isRejected = action => (
  endsWith(action.type, promiseTypes.REJECTED));

import {
  ADD_COLLECTION_MAPPING,
  CLEAR_ERROR,
  DELETE_COLLECTION_MAPPING,
  LOAD_ANNOTATIONS_PROXY,
  SAVE_ANNOTATED_ITEMS_PROXY,
  SELECT_ELEMENT_PROXY,
  SET_CONTEXT_KEY,
  SET_CURRENT_FIELD,
