  };
}

export function loadAnnotations() {
  return {
    type: LOAD_ANNOTATIONS_PROXY,
  };
}

export function saveAnnotatedItems() {
  return {
    type: SAVE_ANNOTATED_ITEMS_PROXY,
  };
}

export function selectElement(selector, content, append = false) {
  return {
    selector,
    content,
    append,
    type: SELECT_ELEMENT_PROXY,
  };
}

export function setContextKey(contextKey) {
  return {
    contextKey,
    type: SET_CONTEXT_KEY,
  };
}

export function setCurrentField(annotationName, collectionIndex, fieldName) {
  return {
    annotationName,
    collectionIndex,
    fieldName,
    type: SET_CURRENT_FIELD,
  };
}

export function updateField(
  annotationName, collectionIndex, fieldName, mapping, append = false,
) {
  return {
    annotationName,
    collectionIndex,
    fieldName,
    mapping,
    append,
    type: UPDATE_FIELD_PROXY,
  };
}

import swal from 'sweetalert2';
import { Store } from 'react-chrome-redux';

import { PORT_NAME } from 'redux/constants';
import { clearError } from 'redux/proxyActions';

export default function setupProxyStore() {
  const store = new Store({
    portName: PORT_NAME,
  });

  store.subscribe(() => {
    // Generic error handler
    const state = store.getState();
    if (state.error) {
      swal('Oops...', 'An error occurred 😭', 'error');
      store.dispatch(clearError());
    }
  });

  return store;
}

import cloneDeep from 'lodash.clonedeep';
import isUndefined from 'lodash.isundefined';
import mapValues from 'lodash.mapvalues';
import PropTypes from 'prop-types';

import annotatedItemField, {
  annotatedItemFieldType,
} from 'redux/reducers/annotatedItemField';
import {
  ADD_COLLECTION_MAPPING,
  DELETE_COLLECTION_MAPPING,
  LOAD_ANNOTATIONS,
  UPDATE_FIELD,
} from 'redux/constants';

export const annotatedItemType = PropTypes.shape({
  updated: PropTypes.bool,
  schema: PropTypes.shape({
    multiple: PropTypes.bool,
    fields: PropTypes.objectOf(PropTypes.string).isRequired,
  }).isRequired,
  collectionMappings: PropTypes.arrayOf(
    PropTypes.objectOf(annotatedItemFieldType),
  ).isRequired,
});

export default function annotatedItem(state, action) {
  const newCollectionMapping = () => mapValues(state.schema.fields, () => (
    annotatedItemField(undefined, action)
  ));

  switch (action.type) {
    case LOAD_ANNOTATIONS.FULFILLED:
      if (isUndefined(state.collectionMappings)) {
        // State is being loaded for the first time without pre-mapped content
        return {
          ...state,
          collectionMappings: [newCollectionMapping()],
        };
      }
      // Schema is being reloaded
      return {
        ...state,
        collectionMappings: state.collectionMappings.map(
          // Ensure all mappings contain only fields from new schema
          collectionMapping => mapValues(state.schema.fields, (fieldType, fieldName) => (
            annotatedItemField(collectionMapping[fieldName], action)
          )),
        ),
      };

    case ADD_COLLECTION_MAPPING: {
      return {
        ...state,
        updated: true,
        collectionMappings: [
          ...state.collectionMappings,
          newCollectionMapping(),
        ],
      };
    }

    case DELETE_COLLECTION_MAPPING: {
      const newState = cloneDeep(state);
      newState.collectionMappings.splice(action.collectionIndex, 1);
      return {
        ...newState,
        updated: true,
      };
    }

    case UPDATE_FIELD: {
      const newState = cloneDeep(state);
      newState.collectionMappings[action.collectionIndex] = {
        ...state.collectionMappings[action.collectionIndex],
        [action.fieldName]: (
          annotatedItemField(
            state.collectionMappings[action.collectionIndex][action.fieldName], action)
        ),
      };
      return {
        ...newState,
        updated: true,
      };
    }

    default: {
      return state;
    }
  }
}

import defaults from 'lodash.defaults';
import PropTypes from 'prop-types';

import { LOAD_ANNOTATIONS, UPDATE_FIELD } from 'redux/constants';

const initialState = {
  // TODO(jrbotros): also store the URL for this selector
  content: '',
  original: '',
  sources: [],
};

export const annotatedItemFieldType = PropTypes.shape({
  content: PropTypes.string,
  original: PropTypes.string,
  sources: PropTypes.arrayOf(PropTypes.string),
});

export default function annotatedItemField(state = initialState, action) {
  switch (action.type) {
    case LOAD_ANNOTATIONS.FULFILLED:
      return defaults(state, initialState);
    case UPDATE_FIELD:
      if (action.append) {
        return {
          ...state,
          content: `${state.content}\n${action.mapping.content}`,
          original: `${state.original}\n${action.mapping.content}`,
          sources: [...state.sources, ...action.mapping.sources],
        };
      }
      return defaults({
        ...state,
        content: action.mapping.content,
        original: action.mapping.content,
        sources: action.mapping.sources,
      }, initialState);
    default:
      return state;
  }
}

import isUndefined from 'lodash.isundefined';
import mapValues from 'lodash.mapvalues';
import PropTypes from 'prop-types';

import annotatedItem, {
  annotatedItemType,
} from 'redux/reducers/annotatedItem';
import {
  ADD_COLLECTION_MAPPING,
  DELETE_COLLECTION_MAPPING,
  LOAD_ANNOTATIONS,
  UPDATE_FIELD,
} from 'redux/constants';

export const annotationContextType = PropTypes.objectOf(annotatedItemType);

export default function annotationContext(state, action) {
  switch (action.type) {
    case LOAD_ANNOTATIONS.FULFILLED: {
      return mapValues(action.payload.schema, (schema, name) => {
        // Get data already mapped, if any
        if (isUndefined(state)) {
          // State is being loaded for the first time
          return annotatedItem({
            schema,
            collectionMappings: action.payload.mappings[name],
          }, action);
        }
        // Ensure annotations are only those found in the new schema
        return annotatedItem({ ...state[name], schema }, action);
      });
    }

    // Passthrough actions
    case ADD_COLLECTION_MAPPING:
    case DELETE_COLLECTION_MAPPING:
    case UPDATE_FIELD: {
      return {
        ...state,
        [action.annotationName]: (
          annotatedItem(state[action.annotationName], action)
        ),
      };
    }

    default: {
      return state;
    }
  }
}

import mapValues from 'lodash.mapvalues';

import annotationContext from 'redux/reducers/annotationContext';
import { isRejected } from 'redux/promiseHelpers';
import {
  ADD_COLLECTION_MAPPING,
  CLEAR_ERROR,
  DELETE_COLLECTION_MAPPING,
  LOAD_ANNOTATIONS,
  SET_CONTEXT_KEY,
  SET_CURRENT_FIELD,
  UPDATE_FIELD,
} from 'redux/constants';

const defaultContextKey = 'tentDefault';

const initialState = {
  contexts: {
    [defaultContextKey]: annotationContext(undefined, {}),
  },
  currentContextKey: defaultContextKey,
  currentAnnotation: null,
  currentIndex: null,
  currentField: null,
  error: null,
  ready: false,
};

export default function main(state = initialState, action) {
  if (isRejected(action)) {
    // If a promise payload is rejected, skip logic and return error state
    return {
      ...state,
      error: true,
    };
  }

  switch (action.type) {
    case CLEAR_ERROR: {
      return {
        ...state,
        error: false,
      };
    }
    case LOAD_ANNOTATIONS.FULFILLED: {
      return {
        ...state,
        ready: true,
        contexts: mapValues(
          state.contexts, context => annotationContext(context, action)),
      };
    }
    case SET_CONTEXT_KEY: {
      return {
        ...state,
        contexts: {
          ...state.contexts,
          [action.contextKey]: (
            annotationContext(state.contexts[action.contextKey], action)
          ),
        },
        currentContextKey: action.contextKey,
        currentAnnotation: null,
        currentIndex: null,
        currentField: null,
      };
    }
    case SET_CURRENT_FIELD: {
      return {
        ...state,
        currentAnnotation: action.annotationName,
        currentIndex: action.collectionIndex,
        currentField: action.fieldName,
      };
    }

    // Passthrough actions
    case ADD_COLLECTION_MAPPING:
      return {
        ...state,
        contexts: {
          ...state.contexts,
          [state.currentContextKey]: (
            annotationContext(state.contexts[state.currentContextKey], action)
          ),
        },
      };
    case DELETE_COLLECTION_MAPPING:
    case UPDATE_FIELD: {
      return {
        ...state,
        contexts: {
          ...state.contexts,
          [state.currentContextKey]: (
            annotationContext(state.contexts[state.currentContextKey], action)
          ),
        },
      };
    }

    default: {
      return state;
    }
  }
}

import get from 'lodash.get';
import mapValues from 'lodash.mapvalues';
import pickBy from 'lodash.pickby';
import { createSelector } from 'reselect';

export const annotationContextsSelector = state => state.contexts;
export const currentAnnotationSelector = state => state.currentAnnotation;
export const currentIndexSelector = state => state.currentIndex;
export const currentFieldSelector = state => state.currentField;
export const readySelector = state => state.ready;

export const currentContextKeySelector = state => state.currentContextKey;

export const currentContextSelector = createSelector(
  annotationContextsSelector,
  currentContextKeySelector,
  (contexts, currentContextKey) => get(contexts, currentContextKey),
);

export const currentAnnotatedItemSelector = createSelector(
  currentContextSelector,
  currentAnnotationSelector,
  (context, annotationName) => context[annotationName],
);

export const currentFieldTypeSelector = createSelector(
  currentAnnotatedItemSelector,
  currentFieldSelector,
  (currentAnnotatedItem, currentField) => (
    get(currentAnnotatedItem, ['schema', 'fields', currentField])
  ),
);

export const currentMappingsSelector = createSelector(
  currentContextSelector,
  context => (
    mapValues(
      pickBy(context, annotatedItem => annotatedItem.updated),
      annotatedItem => annotatedItem.collectionMappings)),
);

# Tent
Tent is an extension for Google Chrome allowing users to map web content to a list of annotations.

## Contexts
In Tent, content mapped to the provided annotations is grouped together in a context. This context is keyed by an arbitrary string in the redux state, and might represent a specific user tagging content in the extension or a project that content is being tagged for.

To switch contexts from another extension or webpage (e.g., if a user first reads an instruction page, you can set the project context from there), you can send a message to the extension with:

```
chrome.runtime.sendMessage(
  EXTENSION_ID, {
    data: {
      contextKey: 'project-1234',
    },
  },
);
```

Make sure you configure [`externally_connectable`](https://developer.chrome.com/extensions/manifest/externally_connectable) in `manifest.json` to accept messages from the sender extension or web page.

You can get your `EXTENSION_ID` [from the Chrome store](https://developer.chrome.com/webstore/publish#get-the-app-id) once you've published your extension, or [generate your own](http://stackoverflow.com/questions/23873623/obtaining-chrome-extension-id-for-development) for development purposes only.

**By default, all mapped content is stored in a default context, so if you don't need to switch contexts you can ignore the concept entirely.**

## Publishing
Create the extension zipfile with `yarn package` and follow the web store [instructions](https://developer.chrome.com/webstore/publish). If you want to upload a new extension zipfile, you'll need to bump the version accordingly with `yarn package -- (patch|minor|major)`.
